DROP TABLE IF EXISTS `candidate`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `candidate` (
  `candidateid` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) DEFAULT NULL,
  `enrolleddate` date DEFAULT NULL,
  `email` varchar(100) DEFAULT NULL,
  `course` varchar(50) NOT NULL DEFAULT 'QA',
  `phone` varchar(100) DEFAULT NULL,
  `status` varchar(100) DEFAULT NULL,
  `workstatus` varchar(100) DEFAULT NULL,
  `education` varchar(100) DEFAULT NULL,
  `workexperience` varchar(100) DEFAULT NULL,
  `ssn` varchar(45) DEFAULT NULL,
  `agreement` char(1) DEFAULT 'N',
  `promissory` char(1) DEFAULT 'N',
  `driverslicense` char(1) DEFAULT 'N',
  `workpermit` char(1) DEFAULT 'N',
  `wpexpirationdate` date DEFAULT NULL,
  `offerletter` char(1) DEFAULT 'N',
  `secondaryemail` varchar(100) DEFAULT NULL,
  `secondaryphone` varchar(45) DEFAULT NULL,
  `address` varchar(100) DEFAULT NULL,
  `city` varchar(100) DEFAULT NULL,
  `state` varchar(100) DEFAULT NULL,
  `country` varchar(100) DEFAULT NULL,
  `zip` varchar(100) DEFAULT NULL,
  `linkedin` char(1) DEFAULT NULL,
  `dob` date DEFAULT NULL,
  `emergcontactname` varchar(100) DEFAULT NULL,
  `emergcontactemail` varchar(100) DEFAULT NULL,
  `emergcontactphone` varchar(100) DEFAULT NULL,
  `emergcontactaddrs` varchar(100) DEFAULT NULL,
  `guidelines` char(1) DEFAULT 'N',
  `ssnvalidated` char(1) DEFAULT 'N',
  `bgv` char(1) DEFAULT 'N',
  `term` varchar(45) DEFAULT NULL,
  `feepaid` decimal(10,2) DEFAULT NULL,
  `feedue` decimal(10,2) DEFAULT NULL,
  `salary0` varchar(100) DEFAULT NULL,
  `salary6` varchar(100) DEFAULT NULL,
  `salary12` varchar(100) DEFAULT NULL,
  `guarantorname` varchar(300) DEFAULT NULL,
  `guarantordesignation` varchar(300) DEFAULT NULL,
  `guarantorcompany` varchar(300) DEFAULT NULL,
  `contracturl` varchar(250) DEFAULT NULL,
  `empagreementurl` varchar(250) DEFAULT NULL,
  `offerletterurl` varchar(250) DEFAULT NULL,
  `dlurl` varchar(250) DEFAULT NULL,
  `workpermiturl` varchar(250) DEFAULT NULL,
  `ssnurl` varchar(250) DEFAULT NULL,
  `referralid` int(11) DEFAULT NULL,
  `portalid` int(11) DEFAULT NULL,
  `avatarid` int(11) DEFAULT NULL,
  `notes` text,
  `batchname` varchar(100) NOT NULL,
  `coverletter` text,
  `background` text,
  `recruiterassesment` text,
  `instructorassesment` text,
  `processflag` char(1) NOT NULL DEFAULT 'N',
  `defaultprocessflag` char(1) NOT NULL DEFAULT 'N',
  `originalresume` varchar(300) DEFAULT NULL,
  `lastmoddatetime` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `statuschangedate` date DEFAULT NULL,
  `diceflag` char(1) DEFAULT 'N' COMMENT 'This flag is set to ''Y'' if its a dice candidate, otherwise ''N''',
  `batchid` int(11) NOT NULL,
  `emaillist` char(1) DEFAULT 'Y',
  PRIMARY KEY (`candidateid`),
  UNIQUE KEY `email_UNIQUE` (`email`),
  KEY `batchname_idx` (`batchname`)
) ENGINE=InnoDB AUTO_INCREMENT=1622 DEFAULT CHARSET=utf8 COMMENT='list of enrolled candidates';
