le in writing\r\ncode in Java programming language and writing test cases in Junit. With this\r\nknowledge, I was not only able to do effective black box testing, but also\r\neffective white box testing.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">With this letter, I have enclosed my resume. With my strong\r\nbackground in testing, I should be able to learn testing of new projects\r\nquickly and would be able to contribute significantly. Kindly consider my\r\nresume for this position. <o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">I can be reached at <phone number=\"\"> or via email at <email_address>.\r\nThank you for your time and consideration.&nbsp;\r\nI look forward to hearing from you. <o:p></o:p></email_address></phone></p>\r\n\r\n<p class=\"MsoNormal\">Sincerely,<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">(Jayasri Valluru)<o:p></o:p></p>			 				 						',NULL,'recruiterassesment',NULL,'N','N','','2013-09-06 12:56:41','0000-00-00','N',8,'Y'),(135,'Shwetha Parab','0000-00-00','shwetau212@gmail.com','QA','408-775-5150','Discontinued','GC','','','274-71-9306','Y','N','N','N','0000-00-00','N','','','2942 Cheswycke Terr,#264','Fremont','CA','USA','94536',NULL,'0000-00-00','','','','','N','N','N','',0.00,0.00,'','','','','','','http://goo.gl/SsAsrc','','','','http://goo.gl/D0rc9b','',0,770,0,'','2013-04',NULL,NULL,'recruiterassesment',NULL,'Y','N','','2013-09-12 23:31:22','2024-11-14','N',6,'Y'),(136,'Smita A Prabhu','2013-09-21','prabhu.smita@gmail.com','QA','408-406-4698','Completed','GC','B.E ( Computer Science)','','','N','N','N','N','0000-00-00','N','','','3958 Stoneridge Dr. Apt #4','Pleasanton','CA','USA','94588',NULL,'1980-03-28','Bala chandra kamath','','925-366-8983','3958, Stone Ridge, DR #4, Pleaston,CA 94588','N','N','N','12 months',475.00,0.00,'55K','60K','65K',NULL,NULL,NULL,'http://goo.gl/qMJvuJ','','','http://goo.gl/0S3xVj','http://goo.gl/VKeStn','',35,987,49,'Completed her project with RBH on 31st OCT 2014','2013-08',NULL,NULL,'recruiterassesment