goo.gl/iloJI9','http://goo.gl/Mh2IY6','http://goo.gl/mCFL81','http://goo.gl/7wBiaE','http://goo.gl/RgZ7tu','http://goo.gl/rycnK0',0,1133,0,'Guarantor Info:\nKrishna Chander Kellepu\nBasswood DR,Sam Ramon CA 94582\n607-576-5919\n','2014-01','			 				 Self-Introduction:<br><br> Ive been working in the Software testing environment for the past <br><br>6years. <br><br> I started my career working as a Manual tester. My job was to develop <br><br>and execute test plans. I also worked at the back-end testing the <br><br>databases using SQL queries. <br><br> Later I moved on to working on automation testing. I developed <br><br>test plans and scripts using Quality center. I worked on <br><br>parameterization,Object Repositories and functional libraries and <br><br>created small framework using QTP. <br><br> In my last 2 projects Ive been working mostly on Java, JUNit ,Testng <br><br>and Selenium. Im also familiar with Core Java concepts. I was <br><br>involved in the testing of internal structure using the Junit and testng <br><br>tool. I worked on Selenium Web driver framework to create financial <br><br>applications on mobile platforms such as IPhone, Android. I worked <br><br>on JAVA based APIs to create scripts. <br><br> My expertise includes functional testing, performance, regression <br><br>testing and manual testing. I worked extensively on developing <br><br>and executing test plans, writing test summary reports and writing <br><br>test scripts for manual and automated testing based on the user <br><br>requirement and also the SRS requirement documents.<br><br>Project1: MobileOps,Sunnyvale<br><br>Project description:<br><br>MobileOps is Mobile Application Management provider, Its provides <br><br>the security, access control to enterprise mobile applications. <br><br>MobilesOps provides a private appstore for the employees, where <br><br>employees can download and install company specific applications . <br><br>And its also provides various security features like encryption for <br><br>the data at rest on mobiles, authentication when the app is launched, <br><br>blocking copy and paste, And it also capture information about <br><br>the application usage on the mobile devices and uploaded to the <br><br>MobileOps server. It provides analytics to Administrators , App <br><br>Developers to find out which application is most used, and which <br><br>application is crashed most and also most popular used devices. <br><br>- I am involved in users and analytics module of this application. <br><br>- In Users module , the adminstrators can create users ,create groups <br><br>and also can import the users by using LDIF(LDAP data interchange <br><br>format) files. Sometimes the adminstrator can export the users and <br><br>groups from corporate LDAP(Lightweight Directory access protocol) <br><br>and import into MobileOps.<br><br>- In analytics Module the adminstrtator will gain insights about which <br><br>mobile application is used most ,what kind of device used most and <br><br>what kind of carrier is used most.It can also tarck which which mobile <br><br>applications are crashing most.<br><br>- I was involved to develop the test plan, and come up with test cases. <br><br>- During the early phase of the development I tested the application <br><br>manually as per the test cases to make sure the application is stable.<br><br>- Then I developed the automation scripts using webdriver and testng <br><br>framework.<br><br>- Then integrated the testng test suites with maven build and configured <br><br>jenkins for continuous integration.<br><br>- In order to do the testing, we worked with the development team to <br><br>come up with a framework . The purpose of the framework was to <br><br>enable us to create test users and test devices.<br><br>- I was also involved in testing the throughput, performance <br><br>by creating test devices as threads and contacting mobilesOps <br><br>simlultaneuosly ,simulating device communiaction with the <br><br>mobileops server.<br><br>- I was involved in Restful Api testing. The interaction between the <br><br>mobile device and mobilesOps server is based on rest api. We got the <br><br>rest api uri document from the developers. Initially I tested the api\'s <br><br>manually by using firefox poster plugin and later automated rest api\'s <br><br>using soapui.<br><br>- Tried POC testing for andriod automation.<br><br> Architecture:<br><br>The architecture for the banking app could be broadly divided into three <br><br>layers:<br><br>Frontend, Middleware and the Backend<br><br>Frontend ----&gt; Middleware (including Cache) --- Backend<br><br>Frontend was mostly done in JavaScript/Ajax. We used Apache Tomcat as a <br><br>middleware and oracle as a database.<br><br>What I learnt from this experience:<br><br>- Rest based Web services,Mobile Tesing<br><br>What are some of the technical challenges you faced:<br><br>-<br><br>What are some of the non-technical challenges you faced:<br><br>-<br><br>1. How did you make your client look good on your last project?<br><br>2. What one problem did you solve on your last project? <br><br>Project2: Art.com ,Emeryville,CA<br><br>Project description:<br><br>Art.com is an e commerce application for art.<br><br>- Art.com sells art,posters to decorate the homes,rooms,offices. There is <br><br>CRM application for art.com customer service representatives. When <br><br>customer calls with an issue with the product which they bought from <br><br>art.com,the customer service representative will enter the issue details <br><br>into the crm application. This system is also used to send the discount <br><br>offers to the registered customers on the special occasions.<br><br>What I did:<br><br>- I was involved in customer contact management and order <br><br>management.<br><br>- The customer contact management inclueds creating update customers <br><br>with information like address, email , phone number.<br><br>- In the Order management it includes the orders placed by the <br><br>customers, open orders, orders status.<br><br>- I was involved in creating test plans and test cases.<br><br>- Developed automated test scripts using webdriver and juint <br><br>framework.<br><br>- Did the web service testing to test the order shipment tracking. <br><br>Various shipping companies like UPS,Fedex provides webservices <br><br>to track the shipment. Those web services are integrated to art.com <br><br>shipment tracking functionality. <br><br>- Did performance testing using jmeter to simulate the number of users <br><br>using the art.com simultaneously. <br><br>What I learnt from this experience:<br><br>- Java,Selenium,Junit,Soap based Web Service,Jmeter<br><br>What are some of the non-technical challenges you faced:<br><br>-<br><br>Project3: Link Tv,SanFrancisco,CA - QA Engineer<br><br>Project description:<br><br>- Link TV is an independent television channel whose mission is to <br><br>engage, inform and inspire viewers to become involved in the world. <br><br>The project was to create a internal web based application to manage <br><br>the schedules, content and partners of Link TV. This application also <br><br>maintains the statistics about the content viewed by the viewers, and <br><br>the reports can be generated by most viewed content, by geography. <br><br>What I did:<br><br>- My tasks were essentially to do functionality, end-to-end, GUI , <br><br>system, configuration and backend testing. <br><br>- Created reusable functions in QTP using VBScript<br><br>- Tested backend databases using SQL queries<br><br>Technical and non technical challenges faced:<br><br>Project5: Biogen Idec ,MA  Manual Tester<br><br>Project description:<br><br>- Biogen Idec is the oldest independent biotechnology company in <br><br>the world. The company\'s R&amp;D efforts are focused on bringing new <br><br>therapies to market for patients with neurodegenerative diseases. The <br><br>project was to create internal web application to track and manage the <br><br>clinical trials, vendors.<br><br>What I did:<br><br>- My tasks were primarily to review the specification,.<br><br>- I developed and executed test plans <br><br>- Tracked metrics on defects, test results etc<br><br>- Validated SQL procedures for appropriate functionalities.<br><br><br><br><br>Unit&nbsp; Testing  I developed some junit test cases. In the junit we have invoked our project api\'s.<br><br>The development team provided us with the api documentation. With the help of that we<br><br>instantiate the objects and invoked them.<br><br>What are the API\'s u worked?<br><br>This project has backeend api documentation to create the user objects,users ,groups, applications,<br><br>application policies.<br><br>&nbsp;<br><br>Functional testing  we will test end to end functionality of the project. For my current project we<br><br>create&nbsp; users&nbsp; ,register&nbsp; the&nbsp; devices&nbsp; on&nbsp; behalf&nbsp; of&nbsp; users&nbsp; ,upload&nbsp; the&nbsp; test&nbsp; mobile&nbsp; application&nbsp; install<br><br>applications, verify application security,revoke application access and test the application on the<br><br>device.<br><br>&nbsp;<br><br>On which devices have you tested?<br><br>Android<br><br>&nbsp;<br><br>System Testing <br><br>&nbsp;<br><br>Integration&nbsp; Testing&nbsp; In&nbsp; my&nbsp; project&nbsp; we&nbsp; integrated&nbsp; the&nbsp; user&nbsp; module&nbsp; with&nbsp; corporate<br><br>LDAP(lightweight directory access protcol)<br><br>LDAP the server which stores the users information.<br><br>&nbsp;<br><br>UAT  In one of my project , the project development was outsourced to a thrid party vendor and<br><br>as a part of project hand over I&nbsp; did user acceptance testing whether the project is meeting the goals<br><br>of my company.<br><br>&nbsp;<br><br>Regression Testing  whenever there Is a new build we will run automated selenium scripts to<br><br>make sure the existing functionality is not broken and still working as expected or not.<br><br>&nbsp;<br><br>Performance Testing &nbsp;&nbsp; I&nbsp; did the&nbsp; performance testing&nbsp; using jmeter to simulate the load&nbsp; on the<br><br>server.<br><br>We simulated a scenario where 1000 devices are contacting the sever simultaneously.<br><br>&nbsp;<br><br>&nbsp;<br><br>&nbsp;<br><br>Security Testing&nbsp; we tested for user authentication and authorization. Try to login with incorrect<br><br>password for authentication. Testing for unauthorized users trying to access the direct url it should<br><br>redirect&nbsp; the&nbsp; user&nbsp; to&nbsp; login&nbsp; page.Tetsing&nbsp; the&nbsp; admin&nbsp; related&nbsp; previliges&nbsp; by&nbsp; normal&nbsp; user&nbsp; for<br><br>authorization.<br><br>&nbsp;<br><br>Hybrid Frameworks When we want to test the test scripts on different browsers at the same time<br><br>is called hybrid framework testing.<br><br>&nbsp;<br><br>Interface Compatability&nbsp; testing&nbsp; the&nbsp; api functionality&nbsp; between&nbsp; different releases&nbsp; like&nbsp; create&nbsp; user<br><br>rest&nbsp; api should work with release&nbsp; 1&nbsp; and the same&nbsp; api should work with&nbsp; next release. For that I<br><br>wrote the test cases to test that.<br><br>Live upgrade  I wrote the test cases to test the live upgrade functionality like during the upgrade<br><br>process the end users still will be able to access and use the application normally.<br><br>&nbsp;<br><br>Accesscontrol&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp; wrote&nbsp; the&nbsp; test&nbsp; cases&nbsp; to&nbsp; test&nbsp; the&nbsp; different&nbsp; users&nbsp; should&nbsp; get&nbsp; their&nbsp; applicable<br><br>privileges like the admin should have all the privileges.<br><br>Multiprivileges&nbsp; : wrote the test cases to test the admin user should have access to regular user<br><br>privileges as well as admin privileges.<br><br>&nbsp;<br><br>Automation Framework uses a combination of HTML, Java, Java Script and Shell scripting.<br><br>Shell scripting is used to invoke the web driver scripts and also it is used to send out the status o f<br><br>the web driver test in email.<br><br>Html to view the test results.<br><br>Java is used to generate the web driver scripts.<br><br>Java script is used selenium web driver as javaScript executor.<br><br>&nbsp;<br><br>DataDriven Testing all the users,applications,policies are stored in the files.<br><br>&nbsp;<br><br>Maven, CI,GIT as a source control for Selenium scripts.<br><br>Maven is used as build and dependency for the application.CI is used as continuous integration to<br><br>run the test scripts automatically whenever there are changes. GIT is a source control tool to check<br><br>in and check out the code.(source code control tool)<br><br>&nbsp;<br><br>JIRA. we used it as a defect management system.<br><br>&nbsp;<br><br>HTTP Samplers, Controllers, Listeners, and PostProcessors in JMETER<br><br>&nbsp;<br><br>&nbsp;<br><br>POC&nbsp; &nbsp; we&nbsp; want&nbsp; to&nbsp; verify&nbsp; and&nbsp; make&nbsp; sure&nbsp; we&nbsp; can&nbsp; automate&nbsp; the&nbsp; andriod&nbsp; application&nbsp; tetsing&nbsp; on<br><br>slendriod.<br><br>MongoDB in this project the devices will periodically sending the information about their status<br><br>whether the&nbsp; device is&nbsp; active&nbsp; or&nbsp; not&nbsp; and&nbsp; also sends which&nbsp; application is&nbsp; used&nbsp; by the&nbsp; users. This<br><br>information is stored using mongodb<br>			 				 				',NULL,'recruiterassesment',NULL,'N','N','','2014-01-18 00:20:09','2024-11-14','N',10,'Y'),(186,'Prashanthi Sathu','2014-01-17','prashanthis.sathu@gmail.com','QA','650-430-6490','Discontinued','GC','BSC','','612-65-1926','N','N','N','N','2018-04-28','N','prashanthisathu@yahoo.com','925-415-0094','610 S black brush Ln','San Ramon','California','United States','94582',NULL,'1979-11-28','Ramya Gopi','ramya18_mouni@yahoo.com','510-378-6530','375 Bell flower court, San Ramon, CA, 94583.','N','Y','N','12',495.00,0.00,'55K','60K','65K',NULL,