.25in;mso-pagination:none;mso-layout-grid-align:\r\nnone;text-autospace:none\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;color:#404040\"><span style=\"mso-spacerun:yes\">&nbsp;</span>Bachelor Education English &amp; Social\r\nStudies Andhra University</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.3in;mso-pagination:none;mso-layout-grid-align:\r\nnone;text-autospace:none\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Master\r\nArts Economics, Annamaliah, University.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:.3in;mso-pagination:none;mso-layout-grid-align:\r\nnone;text-autospace:none\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Child\r\nDevelopment Course, CD12 from De Anza College.</span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">&nbsp;</span></p>\r\n\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n14.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Learned Quickbooks pro- Worked as\r\na payroll Assistant few months.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:76.5pt;mso-add-space:\r\nauto;text-indent:-13.5pt;line-height:normal;mso-list:l0 level1 lfo1;tab-stops:\r\nlist 45.0pt 76.5pt\"><span style=\"mso-bidi-font-size:14.0pt;\r\nfont-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\"><span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n14.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Took CD12 course and worked as an\r\nAssistant Teacher for 6 months. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:76.5pt;mso-add-space:auto;\r\ntext-indent:-13.5pt;line-height:normal;mso-list:l0 level1 lfo1;tab-stops:list 45.0pt 76.5pt\"><span style=\"mso-bidi-font-size:14.0pt;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\"><span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:12.0pt;mso-bidi-font-size:14.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Trained\r\non Oracle BIEE Administration tool for customizing the <span style=\"mso-bidi-font-weight:\r\nbold\">Physical layer, Business layer, Presentation layer</span> and modifying\r\nit according to the business requirements. To <span style=\"mso-bidi-font-weight:\r\nbold\">import physical tables</span> and define joins in the Physical Layer, to\r\nconfigure the connection pools that are automatically created. Developed and\r\ncustomized some of the existing <span style=\"mso-bidi-font-weight:bold\">Dimensions</span>\r\n(Drill-Down Hierarchies) &amp; <span style=\"mso-bidi-font-weight:bold\">Logical\r\nobjects</span> in Business Model Layer, and creating the <span style=\"mso-bidi-font-weight:bold\">Presentation catalogs</span> in Presentation\r\nLayer. Created <span style=\"mso-bidi-font-weight:bold\">Global/Local Prompts,\r\nNarrative Views, Filters, Charts, Pivot Tables, Compound layouts</span> to\r\ndesign the dashboards. Created <span style=\"mso-bidi-font-weight:bold\">Security</span>\r\nsettings in <span style=\"mso-bidi-font-weight:bold\">Oracle Administration Tool</span>\r\nto set up groups, access privileges and query privileges and also managed\r\nsecurity for groups in BI Answers. Developed <span style=\"mso-bidi-font-weight:\r\nbold\">Dashboards</span> for each of metrics by embedding reports and providing\r\nintuitive drill-downs and links to exploit the full benefit of Analytics in\r\nproviding summary 