ege OF New Jersey','Healthcare, Insurance','153-60-2362','N','N','N','N','0000-00-00','N','','','333 Holladay Ct','Livermore','','United States','94551',NULL,'1961-04-14','Andrew J Cafiero','','925-556-0818','7264 Sedgefield Ave, San Ramon, CA 94583','N','N','N','',595.00,0.00,'','','',NULL,NULL,NULL,'http://goo.gl/ttkEls','http://goo.gl/wGKp2n','http://goo.gl/0thZyW','http://goo.gl/On9tmo','','http://goo.gl/On9tmo',0,1480,NULL,'','2015-01',NULL,'<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]-->\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Kaiser Permanente<span style=\"mso-tab-count:7\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></b>10/98 to 6/11</p>\r\n\r\n<p class=\"MsoNormal\"><u>SENIOR DEVELOPEMENT PROGRAMMER</u></p>\r\n\r\n<p class=\"MsoNormal\">Developing and supporting Northern California clinical\r\ninformation database repository, working independently and within a team\r\nenvironment.<span style=\"mso-spacerun:yes\">&nbsp; </span>Developed new CICS and\r\nbatch applications from minimal specifications using: COBOL, CICS, MQ SERIES,\r\nJCL, FILEAID, EXPEDITOR, SAS, DB2, REMEDY, <span style=\"font-family:&quot;Arial&quot;,sans-serif;\r\ncolor:black\">SDLC,</span> CHANGEMAN and MS OFFICE. <span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:27.0pt;text-indent:-.25in;mso-list:l0 level1 lfo1;\r\ntab-stops:list 27.0pt\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\"><span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Analyzed and restructured existing applications\r\nfor measurably increased efficiency. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:27.0pt;text-indent:-.25in;mso-list:l0 level1 lfo1;\r\ntab-stops:list 27.0pt\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\"><span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Conducted rigorous end-to-end regressions\r\ntesting of changes to interconnected interactive data systems, in teams and by\r\nmyself. Created various means to automate testing procedures and test data generation.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:27.0pt;text-indent:-.25in;mso-list:l0 level1 lfo1;\r\ntab-stops:list 27.0pt\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\"><span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"mso-spacerun:yes\">&nbsp;</span>Daily\r\nmonitored network activity of clinical data entry.<span style=\"mso-spacerun:yes\">&nbsp; </span>On call to the end-users for<span style=\"mso-spacerun:yes\">&nbsp; </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:21.0pt\"><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;\r\n</span>technical and application support. Monitored and resolved incidents\r\nusing REMEDY.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:27.0pt;text-indent:-.25in;mso-list:l0 level1 lfo1;\r\ntab-stops:list 27.0pt\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\"><span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Analyzed and wrote technical manuals for older\r\nlegacy systems lacking documentation.<span style=\"mso-spacerun:yes\">&nbsp; </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:27.0pt;text-indent:-.25in;mso-list:l0 level1 lfo1;\r\ntab-stops:list 27.0pt\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\"><span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Lead remediation projects and managing changes\r\nwith multiple partners, using MS Project.<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;\r\n</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:27.0pt;text-indent:-.25in;mso-list:l0 level1 lfo1;\r\ntab-stops:list 27.0pt\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\"><span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Specialized in adapting the Clinical Information\r\nPresentation System to business partner\'s<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>specific\r\nrequirements. Full Development Life Cycle. Created and maintained service\r\nrequests</p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>using REMEDY.\r\nPerformed client interface and application assistance. </p>\r\n\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Data Dimensions, Inc</b>.<span style=\"mso-tab-count:8\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>1/94 to 10/98</p>\r\n\r\n<p class=\"MsoNormal\"><u>SENIOR CONSULTANT, TEAM LEAD, TECHNICAL SPECIALIST</u></p>\r\n\r\n<p class=\"MsoNormal\">Modernization of medical information systems. Specializing\r\nin adapting data applications for the<span style=\"mso-spacerun:yes\">&nbsp; </span></p>\r\n\r\n<p class=\"MsoNormal\">approaching year 2000 (the Y2K issue). Full life cycle\r\ndesign, analysis, coding and testing using such tools as DB2, EXPEDITOR, SAS,\r\nSDF2, FILE-AID, QMF, SPUFI and MS OFFICE.<span style=\"mso-spacerun:yes\">&nbsp;\r\n</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:27.0pt;text-indent:-.25in;mso-list:l1 level1 lfo2;\r\ntab-stops:list 27.0pt\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\"><span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Worked in a team environment in a Project Lead\r\nProgrammer role, supervising all phases of each project and providing technical\r\nexpertise to co-workers.<span style=\"mso-spacerun:yes\">&nbsp; </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:27.0pt;text-indent:-.25in;mso-list:l1 level1 lfo2;\r\ntab-stops:list 27.0pt\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\"><span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Developed innovative solutions and procedures\r\nfor millennium conversion in a high-profile national project.<span style=\"mso-spacerun:yes\">&nbsp; </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:27.0pt;text-indent:-.25in;mso-list:l1 level1 lfo2;\r\ntab-stops:list 27.0pt\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\"><span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span>Developed and supported a wide variety of\r\non-line and batch analytical tools.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:27.0pt;text-indent:-.25in;mso-list:l1 level1 lfo2;\r\ntab-stops:list 27.0pt\"><span style=\"font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol\"><span style=\"mso-list:Ignore\"><span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"mso-spacerun:yes\">&nbsp;</span>Independently developed automated source-code\r\nanalysis system that increased productivity<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;\r\n</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:9.0pt\"><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>of team by 30%.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:9.0pt\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:9.0pt\">Additional professional experience\r\nin the healthcare and insurance fields.</p>\r\n\r\n<br><!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/